import React from 'react'
import "./Header.css";


const Header = () => {
    return (
        <>
            <header className='Header'>
                <div className='h_left'>

                    <img src="fbIcone.png" alt="" />
                </div>


              <div className='h_center'>  </div>
                <div className='h_right'> </div>
            </header>
        </>
    )
}

export default Header
